import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import '../styles/Navbar.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars, faMoon, faSun, faBell, faUser, faSearch, faSignOutAlt } from '@fortawesome/free-solid-svg-icons';
import Logo from './Logo';

const Navbar = () => {
  const [isDarkMode, setIsDarkMode] = useState(false);
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const { user, logout } = useAuth();
  const navigate = useNavigate();
  
  const toggleTheme = () => {
    setIsDarkMode(!isDarkMode);
    // Logic to apply dark theme to the entire app would go here
    document.body.classList.toggle('dark-theme');
  };

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <nav className={`navbar ${isDarkMode ? 'dark' : ''}`}>
      <div className="navbar-container">
        <div className="navbar-left">
          <Link to="/">
            <Logo />
          </Link>
          <div className="search-container">
            <input type="text" placeholder="Search teams, players, news..." />
            <FontAwesomeIcon icon={faSearch} className="search-icon" />
          </div>
        </div>

        <button className="menu-toggle" onClick={toggleMenu}>
          <FontAwesomeIcon icon={faBars} />
        </button>

        <div className={`navbar-links ${isMenuOpen ? 'active' : ''}`}>
          <Link to="/live-scores">Live Scores</Link>
          <Link to="/fixtures">Fixtures</Link>
          <Link to="/teams">Teams</Link>
          <Link to="/news">News</Link>
          <Link to="/features">Features</Link>
          <Link to="/videos">Videos</Link>
          <Link to="/stats">Stats</Link>
          <Link to="/transfers">Transfers</Link>
          <Link to="/laliga-2024-25">LaLiga 2024-25</Link>
        </div>

        <div className="navbar-actions">
          <button className="icon-button" onClick={toggleTheme}>
            <FontAwesomeIcon icon={isDarkMode ? faSun : faMoon} />
          </button>
          <button className="icon-button">
            <FontAwesomeIcon icon={faBell} />
          </button>
          {user ? (
            <div className="user-section">
              <span className="username">{user.username}</span>
              <button className="icon-button logout-button" onClick={handleLogout}>
                <FontAwesomeIcon icon={faSignOutAlt} />
                <span>Logout</span>
              </button>
            </div>
          ) : (
            <Link to="/login" className="auth-button">
              <FontAwesomeIcon icon={faUser} />
              <span>Login / Sign Up</span>
            </Link>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
